<script lang='ts'>
	import { T, useTask } from '@threlte/core'
	import { useGltf, Float } from '@threlte/extras'

	export let floatIntensity: number
	export let rotationSpeed: number
	export let sway: number

	const gltf = useGltf(`data:model/gltf-binary;base64,`)

	$: scene = $gltf?.scene
	$: prop = scene?.getObjectByName('Prop')

	$: scene?.traverse((node: THREE.Object3D) => {
		node.castShadow = true
		node.receiveShadow = true
	})

	let time = 0

	useTask((delta) => {
		if (!prop || !scene) return
		prop.rotation.z -= delta * rotationSpeed
		time += delta
		scene.rotation.z = Math.sin(time) * sway
	})
</script>

{#if $gltf}
	<Float
		{floatIntensity}
		speed={12}
	>
		<T is={$gltf.scene} />
	</Float>
{/if}
